import React from "react";
import Card from "./card.jsx";

const ListCards = ({ robots }) => {
    console.log()
  return (
    <div>
      {robots.map((robot, i) => {
        return (
          <Card
            key={i}
            id={robot[i].id}
            name={robot[i].name}
            email={robot[i].email}
          />
        );
      })}
    </div>
  );
};

export default ListCards;
